import {StyledTitle,Avatar,StyledButton} from "./../components/Styles";

//logo
import Logo from "./../assets/logo.png";

const Home = () => {
    return(
        <div>
            <div style={{
                position:"absolute",
                top:0,
                left:0,
                backgroundColor: "transparent",
                padding:"15px",
                width:"100%",
                display:"flex",
                justifyContent:"flex-start"
            }}>

            </div>
            <div>
                <Avatar image={Logo}/>
            </div>
            <StyledTitle size={65}>
                Welcome to myProject
            </StyledTitle>
            <StyledButton to="/login">Login</StyledButton>
            <StyledButton to="signup">Signup</StyledButton>

        </div>
    );
}

export default Home;
